var TW = TW || {};
TW.SDK = TW.SDK || {};
TW.SDK.Types = TW.SDK.Types || {};

TW.SDK.Types.InfoTable = function (config) {
    var dataShape = new TW.SDK.Types.DataShape();
    var rows = [];
    if (config) {
        if (config.dataShape) {
            dataShape = config.dataShape;
        }
        if (config.rows) {
            rows = config.rows;
        }
    }
    var api = {
        rows: rows,
        dataShape: dataShape
    };
    return api;
};
